Mineshaft
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Description: Convicts Erik Everhard and James Deen escape from prison and enter a gold mining camp which just happens to employ two sexy paroles, Missy Martinez and Allie Haze. Their boss, played by Tommy Gunn, has worked these gorgeous girl the core, since they refuse to succumb to his sexual innuendos. Just when things seem hopeless, the convicts shake things up by giving the girls some much needed pleasure. With criminals on the loose and the cops on the lookout, this is a real find, filled with comedy, sex, and gold!

